5}},u=3301})}}),q(24757,{qgs={37120},sourceQuests={24756},u=3301,g={qo(1,{providers={{"i",49888},{"n",36853}},u=3301})}}),q(24548,{description="These can drop from any of the bosses on 25-Man Normal or Heroic. You need 50 of these, so this quest will take you several weeks to finish.",qgs={37120},sourceQuests={24757},u=3301,g={qo(1,{providers={{"i",50274}},u=3301})}}),q(24912,{qgs={37120},sourceQuests={24548},u=3301}),q(24549,{qgs={37120},sourceQuests={24548},u=3301,g={s(178057,49623,{b=1,c={1,2,6},f=22,lvl=80,q=5,races={1,2,3,4,5,6,7,8,10,11},u=3301}),ach(4623,{c={1,2,6},u=3301})}}),q(24748,{qgs={37120},sourceQuests={24549},u=3301,g={qo(1,{providers={{"n",36597}},u=3301})}}),i(51315,{b=1,description="Dropped by the Lich King on 25-Man difficulty while on the quest |cFFefc400The Lich King's Last Stand|r. Only your first kill will trigger the item to drop. You do NOT need to have Shadowmourne equipped.\n\nThis item contains a lot of BoE cosmetic items that sell very well. During its time, this was used to reward other members of the raid for assisting the guild master (more than likely) with Shadowmourne for the many months it took to complete the quest chain.\n\nIn addition to being very rewarding, these quests were some of the most treasured throughout World of Warcraft's long history.",providers={{"i",51316}},q=4,qgs={36597},questID=24914,sourceQuests={24549},u=3301,g={i(51317,{b=1,description="Alexandros: Darion, my son. At last I am able to lay my eyes upon you again. The Lich King tormented me without end, Darion. Endlessly he sought to break my will, to force me to serve him, to bind me to his blade. Finally, when events demanded his full attention, he left me. The one memory I clung to Darion, the one thought that kept me from giving in, it was your sacrifice, my son. That again saved me from eternal peril.\n\nDarion: Father, father, I… I feared for your sanity, father, for you, I would give my life a thousand times.",q=4,questID=24915,u=3301,g={mnt(73313,{b=2,itemID=52200,lvl=20,q=4,u=3301})}}),i(51319,{b=1,description="Muradin: Oh lad, how I missed those endless days in Lordaeron, sharpening your skill with this dull blade. Forging you into a weapon meant to withstand the demands of a great destiny. Heh… You sure put them skills to use, didn't you lad?\n\nIf only I'd been able to stop you that day, how different things migha' been. If only I'da never discovered that accursed blade. Farewell, Arthas, my brother.",q=4,questID=24917,u=3301,g={toy(52201,{lvl=80,q=4,u=3301})}}),i(51320,{b=1,description="Uther: Arthas... Alas, hero of Azeroth. You give me a greater gift than you know. Long have I struggled to forgive the prince for his terrible transgressions. My soul has been wracked with unbearable anxiety, dark thoughts, distancing me from the light.\n\nI recall clearly... the gleam of pride in his eye as he stood before me, eager to defeat the enemies of the light... eager to defend his people, no matter the cost. It is this memory of Arthas that I choose to keep in my heart.\n\nI shall always be in your debt, friend. Thank you.",q=4,questID=24919,u=3301,g={s(179857,52252,{f=9,lvl=80,q=4,u=3301})}}),i(51321,{b=1,description="Sylvanas: So, it is done. I had not dared to trust my senses. Too many times has the Lich King made me to be a fool. Finally, he has been made to pay for the atrocities he imposed upon my people.\n\nMay Azeroth never fail to remember the horrible price we paid for our weakness, for our pride. But what now, Hero? What of those freed from his grasp but still shackled to their mortal coils?\n\nLeave me. I have much to ponder.",q=4,questID=24918,u=3301,g={toy(52253,{lvl=80,q=4,u=3301})}}),i(51318,{b=1,description="Jaina: What's this?\nHe... he kept it.. all this time he kept it!\n<Cries> I knew!\n<Cries> I sensed a part of him still alive... trapped... struggling. Oh Arthas!\nPerhaps he might someday remember from what he once was...\nBy the Light may he at last find rest, free from the icy grip of that terrible blade!",q=4,questID=24916,u=3301,g={toy(52251,{lvl=80,q=4,u=3301})}})}})}}),h(-12,{u=33,g={ach(4602,{awp=30002,sym={{"meta_achievement",4628,4629,4630,4631,4534,4535,4536,4537,4538,4577,4578,4582,4539,4579,4580,4601}},u=33,g={mnt(72808,{awp=30300,b=1,itemID=51954,lvl=70,q=4,u=33})}}),ach(4603,{awp=30002,sym={{"meta_achievement",4632,4633,4634,4635,4610,4611,4612,4613,4614,4615,4616,4617,4618,4619,4620,4621,4622}},u=33,g={mnt(72807,{awp=30300,b=1,itemID=51955,lvl=70,q=4,u=33})}}),ach(4532,{sym={{"meta_achievement",4531,4528,4529,4527,4530}},u=33}),ach(4608,{sym={{"meta_achievement",4604,4605,4606,4607,4597}},u=33}),ach(4636,{sym={{"meta_achievement",4628,4629,4630,4631,4583}},u=33}),ach(4637,{sym={{"meta_achievement",4632,4633,4634,4635,4584}},u=33}),ach(4598,{minReputation={1156,42000},u=33,g={title(141,{u=33})}}),ach(4576,{awp=30303,providers={{"n",36597}},rwp=30305,u=2})}}),h(-31,{u=33,g={faction(1156,{u=33})}}),h(-45,{u=33,g={q(24815,{description="If the quest does not appear when you hit Friendly, you may have to relog.",minReputation={1156,3000},qgs={38316},u=33,g={i(50375,{b=1,c={1,2,6},f=52,lvl=80,q=4,u=33}),i(50377,{b=1,c={2,5,7,8,9,11},f=52,lvl=80,q=4,u=33}),i(52569,{b=1,c={1,2,6},f=52,q=4,u=33}),i(50376,{b=1,c={3,4,7,11},f=52,lvl=80,q=4,u=33}),i(50378,{b=1,c={2,5,7,8,9,11},f=52,lvl=80,q=4,u=33})}}),q(24827,{c={1,2,6},minReputation={1156,9000},qgs={38316},sourceQuests={24815},u=33,g={i(50388,{b=1,c={1,2,6},f=52,lvl=80,q=4,u=33})}}),q(24834,{c={1,2,6},minReputation={1156,21000},qgs={38316},sourceQuests={24827},u=33,g={i(50403,{b=1,c={1,2,6},f=52,lvl=80,q=4,u=33})}}),q(24835,{c={1,2,6},minReputation={1156,42000},qgs={38316},sourceQuests={24834},u=33,g={i(50404,{b=1,c={1,2,6},f=52,lvl=80,q=4,u=33})}}),q(24828,{c={2,5,7,8,9,11},minReputation={1156,9000},qgs={38316},sourceQuests={24815},u=33,g={i(50384,{b=1,c={2,5,7,8,9,11},f=52,lvl=80,q=4,u=33})}}),q(24823,{c={2,5,7,8,9,11},minReputation={1156,21000},qgs={38316},sourceQuests={24828},u=33,g={i(50397,{b